- false positive - find relation of points, which were incorrectly counted as line points, but do not belong to extracted lines, to total amount of line points (together with noisy points and outliers); 
- false negative - find relation of missed points, which should belong to extracted lines, to total amount of line points (together with noisy points and outliers); 
- precision - how close the extracted line lays to a real line position, to count this you can use regression metrics like Ordinary Least Squares (OLS), or, as was written, count manually
